<h3>About Us</h3>
<p>Cajegas, Angelo</p>
<p>Tesaluna, Josh</p>
<p>Basalo, Michael</p>
<p>Paquero, Ronan</p>
<p>Cagampang, Emmanuel</p>
</div>
<div className="footer-bottom">
<p>Â© 2020 TeknoLib. All rights reserved.</p>
</div>
</footer>
</div>
  );
}
 
export default StudentList;
